import React from 'react';


export default class Article extends React.Component{
  render() {

    const articlesData = this.props.articles;


    let articles = articlesData.map((article) =>
      <li key={article.id} className="article-list__item">{article.title}</li>

	);



	return(
      <ul className="article-list">{articles}</ul>
	)
  }
}
